import React, {Component} from 'react'

class Profile extends Component {
    constructor(props) {
    super(props);

    this.state = {
        currentProfile: props.userProfile
    }
    }

    render() {    
    return (
        <div>            
            {this.state.currentProfile.username}
        </div>
    )  
}
}

export default Profile;
